import { mockGuilds } from "../_mocks_/guilds";



export const MenuPage = () => {
    const navigate = useNavigate();
    return (
        <div>
            <ul>
                {mockGuilds.map((guild) => (
                <li>{guild.name}</li>

                ))}
            </ul>
        </div>
    );
};
